// pages/Favorites.js
import React from 'react';
import Footer from '../components/Footer';

const Favorites = () => {
  return (
    <div>
      <h2>Избранное</h2>
      <p>Здесь будет список избранных товаров.</p>
      <Footer/>
    </div>
  );
};

export default Favorites;
